const Navbar = ({ adminNav }) => {
  const [isOpen, setIsOpen] = useState(false);
//   const navigate = useNavigate();
  const [cookies, removeCookie] = useCookies(["token"]);

  const toggle = () => {
    setIsOpen((prev) => !prev);
  };

  const handleDashboard = async () => {
    if (cookies?.token !== "undefined") {
      console.log(cookies.token);
      try {
        const { data } = await axios.get("https://api.showcaseurbusiness.com/user/infor", {
          headers: {
            Authorization: cookies?.token,
          },
        });

        if (data?.role === 1) {
        //   navigate("/businessProfile/businessDashboard");
        }
        if (data?.role === 0) {
        //   navigate("/dashboard/normalDashboard");
        }
      } catch (err) {
        if (err?.response?.status === 403 || err?.response?.status === 400) {
          removeCookie("token");
        //   navigate("/auth");
        }
        console.log(err);
      }
    } else {
      removeCookie("token");
    //   navigate("/auth");
    }
  };

//   const [user] = useAuthState(auth);

  const handleSignOut = () => {
    // signOut(auth);
    localStorage.removeItem("token");
    removeCookie("token");
    // navigate("/");
  };

  // for filtering data
  const handleOption = (content, user) => {
    // navigate(`/products/${content}-${user}`);
  };

  const handleKeyDown = (event) => {
    if (event.key === "Enter") {
    //   navigate(`/products/${event.target.value}-input`);
    }
  };

  return (
    <div className="bg-gray-300 md:py-2 px-6 py-0">
      <div className="flex items-center justify-between">
        {/* Logo */}
        <div className="flex gap-[10px] md:gap-8 items-center justify-between ">
          {/* <img
            onClick={() => navigate("/")}
            src={logo}
            alt="logo"
            className="h-[57px] w-[110px] cursor-pointer"
          /> */}
          {/* Search  */}
         
          <div className="md:w-auto w-[157px]  bg-white-400 py-22  square-2xl">
            <label className="input-group">
              <span className="bg-inherit">
                {/* <BiSearchAlt className="text--900" /> */}
              </span>
              <input
                type="text"
                placeholder="Search..."
                className="outline-none border-none bg-inherit"
                onKeyDown={handleKeyDown}
              />
            </label>
          </div>
        </div>
        {!adminNav && (
          <div className="lg:flex hidden  items-center justify-center gap-9   ">
            <h1
            //   onClick={() => navigate(`/products/${"product-allVideo"}`)}
              className="text-md text-gray-400 cursor-pointer hover:text-black transition-colors delay-75 ease-in-out"
            >
              All Videos
            </h1>
            <div className="dropdown dropdown-hover">
              <h1
                tabIndex={0}
                className="text-md flex items-center gap-2 text-gray-400 cursor-pointer hover:text-black transition-colors delay-75 ease-in-out"
              >
                {/* Men <FiChevronDown /> */}
              </h1>
              <ul
                tabIndex={0}
                className="menu dropdown-content p-2 shadow bg-base-100 rounded-box w-52 "
